import { combineReducers } from "redux";
import reducer from "./reducer";
import mstreducer from "./reducer";
import guesses from "./reducer";

const reducers = combineReducers({
  player: reducer,
  misstakes: mstreducer,
  guessed: guesses,
});

export default reducers;
